import React from "react";
function CardPic(props) {
  return (
    <>
      <div className="card">
        <div className="card-header">
          {props.image}
        </div>
        <div className="card-body">
          <p>{props.date}</p>
          <p>{props.text}</p>
        </div>
      </div>
    </>
  );
}

export default CardPic;
